import React, { Component } from "react";
import KeresService from "../service/KeresService";

class KeresekComponent extends Component {
  constructor(props) {
    super(props);

    this.state = {
      keresek: [],
    };
  }

  componentDidMount() {
    KeresService.getKeresek()
      .then((res) => {
        this.setState({ keresek: res.data });
      })
      .catch(function (ex) {
        console.log("Response parsing failed. Error: ", ex);
      });
  }

  render() {
    return (
      <div>
        <table className="keresekTable">
          <thead>
            <tr>
              <th>Anyajobbful</th>
              <th>Anyabalful</th>
              <th>Apajobbful</th>
              <th>Apabalful</th>
              <th>bakok</th>
              <th>nostenyek</th>
              <th>fajta</th>
              <th>szin</th>
              <th>szuldat</th>
              <th>tenyeszto</th>
            </tr>
          </thead>
          <tbody>
            {this.state.keresek.map((keres) => (
              <tr key={keres.id}>
                <td>{keres.anyajobbful}</td>
                <td>{keres.anyabalful}</td>
                <td>{keres.apajobbful}</td>
                <td>{keres.keresbalful}</td>
                <td>{keres.bakok}</td>
                <td>{keres.nostenyek}</td>
                <td>{keres.fajta}</td>
                <td>{}</td>
                <td>valamik1</td>
                <td>sok1</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    );
  }
}

export default KeresekComponent;
